import React, { useState } from 'react';
import axios from 'axios';

const RandomDataGenerator = () => {
    const [region, setRegion] = useState('');
    const [errors, setErrors] = useState(0);
    const [seed, setSeed] = useState('');
    const [page, setPage] = useState(1);
    const [data, setData] = useState([]);

    // Обработчик изменения поля ошибок
    const handleErrorsChange = (value) => {
        // Округляем значение до двух знаков после запятой
        const errorValue = parseFloat(value).toFixed(2);
        setErrors(errorValue);
    };

    // Функция для генерации данных
    const handleGenerate = async () => {
        try {
            const response = await axios.post('http://localhost:3000/generate', {
                region,
                errors: parseFloat(errors), // Передаем корректное значение ошибок
                seed,
                page,
            });
            setData(response.data);
        } catch (error) {
            console.error('Error generating data:', error);
        }
    };

    return (
        <div className="container mt-5">
            <h1 className="mb-4">Random Data Generator</h1>

            <div className="row mb-4">
                <div className="col-md-4">
                    <select
                        className="form-control"
                        value={region}
                        onChange={(e) => setRegion(e.target.value)}
                    >
                        <option value="">Select Language</option>
                        <option value="en">English</option>
                        <option value="de">Deutsch</option>
                        <option value="pl">Polski</option>
                    </select>
                </div>

                {/* Поле для ввода количества ошибок */}
                <div className="col-md-2">
                    <input
                        type="number"
                        className="form-control"
                        placeholder="Error Count"
                        value={errors}
                        min="0"
                        max="1000"
                        step="0.25"
                        onChange={(e) => handleErrorsChange(e.target.value)}
                    />
                </div>

                {/* Слайдер для изменения количества ошибок */}
                <div className="col-md-4">
                    <input
                        type="range"
                        className="form-control-range"
                        value={errors}
                        min="0"
                        max="10"
                        step="0.25"
                        onChange={(e) => handleErrorsChange(e.target.value)}
                    />
                </div>

                <div className="col-md-2">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Seed"
                        value={seed}
                        onChange={(e) => setSeed(e.target.value)}
                    />
                </div>
                <div className="col-md-2">
                    <input
                        type="number"
                        className="form-control"
                        placeholder="Page Number"
                        value={page}
                        onChange={(e) => setPage(e.target.value)}
                    />
                </div>
                <div className="col-md-2">
                    <button onClick={handleGenerate} className="btn btn-primary w-100">
                        Generate
                    </button>
                </div>
            </div>

            <h2>Generated Data:</h2>

            <table className="table table-striped">
                <thead className="thead-dark">
                <tr>
                    <th>#</th>
                    <th>UUID</th>
                    <th>Name</th>
                    <th>Address</th>
                    <th>Phone</th>
                </tr>
                </thead>
                <tbody>
                {data.map((item, index) => (
                    <tr key={item.uuid}>
                        <td>{index + 1}</td>
                        <td>{item.uuid}</td>
                        <td>{item.name}</td>
                        <td>{item.address}</td>
                        <td>{item.phone}</td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default RandomDataGenerator;
